import React from "react";
let x, y;
function add(x, y) {
  return x + y;
}
function multiply(x, y) {
  return x * y;
}
function subtract(x, y) {
  return x - y;
}
function divide(x, y) {
  return x / y;
}

export { add, multiply, divide, subtract };
